 {'turn id': 7, 'user utterance': "Well, obviously, the black students try to break it up and there's also an incident where one guy, Reggie, gets a loaded gun pointed at him by a campus policeman after he gets into an argument with a white student. It may be at another party, though, I'm not sure of that.", 'system response': 'Oh, that sounds pretty strong stuff. What else happens?', 'dialog history': "<USER> Hi, what you up to? <SYSTEM> Not much, chilling out. <USER> Just rewatching Dear White People on Netflix, love it!😍 <SYSTEM> Oh yeah, heard of it, but not seen it yet? Any good? <USER> Well, yes! I just said it was, LOL. It's about a fictional Ivy League University and the students in one House of Residence. <SYSTEM> Why is it called Dear White People? <USER> That's the name of the radio show the main character, Sam, presents on college radio. <SYSTEM> Yeah, but why is it so good? <USER> Well, it's mainly stories from the perspective of black students there, which I find very interesting. The characters are strong and likeable too. <SYSTEM> I suppose it's rather different from the UK, then? <USER> It seems so, as there is a lot more racial awareness and discrimination there than here. It all kicks off when there is a Blackface party held by an elite group of white students, which gets out of hand. <SYSTEM> How's that?", 'original user side information': '{"speaker": "Clara"}', 'original system side information': '{"speaker": "Neela"}'}
 {'turn id': 8, 'user utterance': 'Well, there is a young black guy called Lionel who is coming to terms with being gay and is finding his voice as a journalist. He unearths corruption at the uni and he and Sam also uncover some conspiracy theory stuff about secret societies.', 'system response': "Well, I must say, it does sound good, I'll check it out soon!", 'dialog history': "<USER> Hi, what you up to? <SYSTEM> Not much, chilling out. <USER> Just rewatching Dear White People on Netflix, love it!😍 <SYSTEM> Oh yeah, heard of it, but not seen it yet? Any good? <USER> Well, yes! I just said it was, LOL. It's about a fictional Ivy League University and the students in one House of Residence. <SYSTEM> Why is it called Dear White People? <USER> That's the name of the radio show the main character, Sam, presents on college radio. <SYSTEM> Yeah, but why is it so good? <USER> Well, it's mainly stories from the perspective of black students there, which I find very interesting. The characters are strong and likeable too. <SYSTEM> I suppose it's rather different from the UK, then? <USER> It seems so, as there is a lot more racial awareness and discrimination there than here. It all kicks off when there is a Blackface party held by an elite group of white students, which gets out of hand. <SYSTEM> How's that? <USER> Well, obviously, the black students try to break it up and there's also an incident where one guy, Reggie, gets a loaded gun pointed at him by a campus policeman after he gets into an argument with a white student. It may be at another party, though, I'm not sure of that. <SYSTEM> Oh, that sounds pretty strong stuff. What else happens?", 'original user side information': '{"speaker": "Clara"}', 'original system side information': '{"speaker": "Neela"}'}
