 {'turn id': 6, 'user utterance': 'It was for us as well! Will you come back again?', 'system response': 'Of course! Any time!', 'dialog history': "<USER> Thanks for sharing your collection with the class. They loved it! <SYSTEM> No problem! It was my pleasure! <USER> Not everyday you get to see some of those up close and personal like that. We were wowed! <SYSTEM> Oh, gee, that's so nice! <USER> You have a great collection, you should be proud! <SYSTEM> I am, but not everyone appreciates it. <USER> Fossils are a unique thing to collect, that's for sure. <SYSTEM> If you leave them sitting around, they just become dust magnets! <USER> So it's good to share them. <SYSTEM> Especially with little kids, they get so amazed! It was a fun day.", 'original user side information': '{"speaker": "Enrique"}', 'original system side information': '{"speaker": "Farrah"}'}
 {'turn id': 7, 'user utterance': 'I was thinking that our 4th grade students would like to check them out as well. Can I give your name and number to that teacher?', 'system response': 'Sure thing.', 'dialog history': "<USER> Thanks for sharing your collection with the class. They loved it! <SYSTEM> No problem! It was my pleasure! <USER> Not everyday you get to see some of those up close and personal like that. We were wowed! <SYSTEM> Oh, gee, that's so nice! <USER> You have a great collection, you should be proud! <SYSTEM> I am, but not everyone appreciates it. <USER> Fossils are a unique thing to collect, that's for sure. <SYSTEM> If you leave them sitting around, they just become dust magnets! <USER> So it's good to share them. <SYSTEM> Especially with little kids, they get so amazed! It was a fun day. <USER> It was for us as well! Will you come back again? <SYSTEM> Of course! Any time!", 'original user side information': '{"speaker": "Enrique"}', 'original system side information': '{"speaker": "Farrah"}'}
