[{'turn id': 1, 'user utterance': 'Hello. I have had a good look and have done some tests on the mould in your spare bedroom upstairs and in the dinign room.', 'system response': 'Hello Andy. Thank you for that, what are your thoughts?', 'dialog history': '', 'original user side information': '{"speaker": "Andy"}', 'original system side information': '{"speaker": "Betty"}'}
 {'turn id': 2, 'user utterance': 'I think it is caused by condensation, as most of the moist settles on and around the windows.', 'system response': 'Why is that?', 'dialog history': '<USER> Hello. I have had a good look and have done some tests on the mould in your spare bedroom upstairs and in the dinign room. <SYSTEM> Hello Andy. Thank you for that, what are your thoughts?', 'original user side information': '{"speaker": "Andy"}', 'original system side information': '{"speaker": "Betty"}'}
 {'turn id': 3, 'user utterance': 'Those are the coldest areas and therefore where the moist in the warm air turns into water. On the windows its just water, on the walls the moist will allow mould to grow.', 'system response': 'So why is it all over the spare room walls, and all around the dining room? but not in other rooms?', 'dialog history': '<USER> Hello. I have had a good look and have done some tests on the mould in your spare bedroom upstairs and in the dinign room. <SYSTEM> Hello Andy. Thank you for that, what are your thoughts? <USER> I think it is caused by condensation, as most of the moist settles on and around the windows. <SYSTEM> Why is that?', 'original user side information': '{"speaker": "Andy"}', 'original system side information': '{"speaker": "Betty"}'}
 {'turn id': 4, 'user utterance': 'Probably because they have external walls which are cooler than internal walls.', 'system response': 'so why only that bedroom and not the other ones?', 'dialog history': '<USER> Hello. I have had a good look and have done some tests on the mould in your spare bedroom upstairs and in the dinign room. <SYSTEM> Hello Andy. Thank you for that, what are your thoughts? <USER> I think it is caused by condensation, as most of the moist settles on and around the windows. <SYSTEM> Why is that? <USER> Those are the coldest areas and therefore where the moist in the warm air turns into water. On the windows its just water, on the walls the moist will allow mould to grow. <SYSTEM> So why is it all over the spare room walls, and all around the dining room? but not in other rooms?', 'original user side information': '{"speaker": "Andy"}', 'original system side information': '{"speaker": "Betty"}'}
 {'turn id': 5, 'user utterance': 'I guess those rooms are most effected as the spare room is next to the bathroom and the dining room next to the kitchen.', 'system response': 'But why isnt there mould on the kitchen and bathroom itself then?', 'dialog history': '<USER> Hello. I have had a good look and have done some tests on the mould in your spare bedroom upstairs and in the dinign room. <SYSTEM> Hello Andy. Thank you for that, what are your thoughts? <USER> I think it is caused by condensation, as most of the moist settles on and around the windows. <SYSTEM> Why is that? <USER> Those are the coldest areas and therefore where the moist in the warm air turns into water. On the windows its just water, on the walls the moist will allow mould to grow. <SYSTEM> So why is it all over the spare room walls, and all around the dining room? but not in other rooms? <USER> Probably because they have external walls which are cooler than internal walls. <SYSTEM> so why only that bedroom and not the other ones?', 'original user side information': '{"speaker": "Andy"}', 'original system side information': '{"speaker": "Betty"}'}
 {'turn id': 6, 'user utterance': "I think that is because the kitchen doesn't have external walls and the bathroom has only one external wall and a fan in it. The difference when i measured it between internal wall and external wall is about 4 degrees.", 'system response': 'Does that mean we need new double glazed windows or new wall insulation?', 'dialog history': '<USER> Hello. I have had a good look and have done some tests on the mould in your spare bedroom upstairs and in the dinign room. <SYSTEM> Hello Andy. Thank you for that, what are your thoughts? <USER> I think it is caused by condensation, as most of the moist settles on and around the windows. <SYSTEM> Why is that? <USER> Those are the coldest areas and therefore where the moist in the warm air turns into water. On the windows its just water, on the walls the moist will allow mould to grow. <SYSTEM> So why is it all over the spare room walls, and all around the dining room? but not in other rooms? <USER> Probably because they have external walls which are cooler than internal walls. <SYSTEM> so why only that bedroom and not the other ones? <USER> I guess those rooms are most effected as the spare room is next to the bathroom and the dining room next to the kitchen. <SYSTEM> But why isnt there mould on the kitchen and bathroom itself then?', 'original user side information': '{"speaker": "Andy"}', 'original system side information': '{"speaker": "Betty"}'}
 {'turn id': 7, 'user utterance': 'Not necessarily. that would make a little difference but would still leave you with moist air in the house, so it would just settle somewhere else.', 'system response': 'So what would you recommend?', 'dialog history': "<USER> Hello. I have had a good look and have done some tests on the mould in your spare bedroom upstairs and in the dinign room. <SYSTEM> Hello Andy. Thank you for that, what are your thoughts? <USER> I think it is caused by condensation, as most of the moist settles on and around the windows. <SYSTEM> Why is that? <USER> Those are the coldest areas and therefore where the moist in the warm air turns into water. On the windows its just water, on the walls the moist will allow mould to grow. <SYSTEM> So why is it all over the spare room walls, and all around the dining room? but not in other rooms? <USER> Probably because they have external walls which are cooler than internal walls. <SYSTEM> so why only that bedroom and not the other ones? <USER> I guess those rooms are most effected as the spare room is next to the bathroom and the dining room next to the kitchen. <SYSTEM> But why isnt there mould on the kitchen and bathroom itself then? <USER> I think that is because the kitchen doesn't have external walls and the bathroom has only one external wall and a fan in it. The difference when i measured it between internal wall and external wall is about 4 degrees. <SYSTEM> Does that mean we need new double glazed windows or new wall insulation?", 'original user side information': '{"speaker": "Andy"}', 'original system side information': '{"speaker": "Betty"}'}
 {'turn id': 8, 'user utterance': 'I would install a fan system, or PIV system, which would circulate air to dilute and take some moisture out of the air. It would be installed in your loft and be on continuously during day and night.', 'system response': 'That sounds good. would that be sufficient?', 'dialog history': "<USER> Hello. I have had a good look and have done some tests on the mould in your spare bedroom upstairs and in the dinign room. <SYSTEM> Hello Andy. Thank you for that, what are your thoughts? <USER> I think it is caused by condensation, as most of the moist settles on and around the windows. <SYSTEM> Why is that? <USER> Those are the coldest areas and therefore where the moist in the warm air turns into water. On the windows its just water, on the walls the moist will allow mould to grow. <SYSTEM> So why is it all over the spare room walls, and all around the dining room? but not in other rooms? <USER> Probably because they have external walls which are cooler than internal walls. <SYSTEM> so why only that bedroom and not the other ones? <USER> I guess those rooms are most effected as the spare room is next to the bathroom and the dining room next to the kitchen. <SYSTEM> But why isnt there mould on the kitchen and bathroom itself then? <USER> I think that is because the kitchen doesn't have external walls and the bathroom has only one external wall and a fan in it. The difference when i measured it between internal wall and external wall is about 4 degrees. <SYSTEM> Does that mean we need new double glazed windows or new wall insulation? <USER> Not necessarily. that would make a little difference but would still leave you with moist air in the house, so it would just settle somewhere else. <SYSTEM> So what would you recommend?", 'original user side information': '{"speaker": "Andy"}', 'original system side information': '{"speaker": "Betty"}'}
 {'turn id': 9, 'user utterance': 'If you buy a decent size it will be, but you would also need to treat your walls to get rid of the current mould. That will not go away by itself.', 'system response': 'OK, is this something your company can help with?', 'dialog history': "<USER> Hello. I have had a good look and have done some tests on the mould in your spare bedroom upstairs and in the dinign room. <SYSTEM> Hello Andy. Thank you for that, what are your thoughts? <USER> I think it is caused by condensation, as most of the moist settles on and around the windows. <SYSTEM> Why is that? <USER> Those are the coldest areas and therefore where the moist in the warm air turns into water. On the windows its just water, on the walls the moist will allow mould to grow. <SYSTEM> So why is it all over the spare room walls, and all around the dining room? but not in other rooms? <USER> Probably because they have external walls which are cooler than internal walls. <SYSTEM> so why only that bedroom and not the other ones? <USER> I guess those rooms are most effected as the spare room is next to the bathroom and the dining room next to the kitchen. <SYSTEM> But why isnt there mould on the kitchen and bathroom itself then? <USER> I think that is because the kitchen doesn't have external walls and the bathroom has only one external wall and a fan in it. The difference when i measured it between internal wall and external wall is about 4 degrees. <SYSTEM> Does that mean we need new double glazed windows or new wall insulation? <USER> Not necessarily. that would make a little difference but would still leave you with moist air in the house, so it would just settle somewhere else. <SYSTEM> So what would you recommend? <USER> I would install a fan system, or PIV system, which would circulate air to dilute and take some moisture out of the air. It would be installed in your loft and be on continuously during day and night. <SYSTEM> That sounds good. would that be sufficient?", 'original user side information': '{"speaker": "Andy"}', 'original system side information': '{"speaker": "Betty"}'}
